import { Link, useLocation } from "react-router-dom";
import "../n.png"
import {FaUser, FaCalendar, FaClock, FaEnvelope, FaBook, FaUserFriends, FaInfoCircle}
    from "react-icons/fa";

function KanbasNavigation() {
    const links = ["Home", "Account", "Dashboard", "Courses", "Inbox", "Groups", "Calendar", "Help"];
    const N = <img src="../n.png" width={80} height={80}></img>
    const icons = [N, <FaUser/>, <FaClock/>, <FaBook/>, <FaEnvelope/>, <FaUserFriends/>, <FaCalendar/>,
    <FaInfoCircle/>]
    const { pathname } = useLocation();
    return (
        <div className="list-group bg-black" style={{ width: 125 }}>
            {links.map((link, index) => (
                <Link
                    key={index}
                    to={`/Kanbas/${link}`}
                    className={`list-group-item ${pathname.includes(link) && "active"}`}>
                    <h2> {icons[index]} </h2> {link}
                </Link>
            ))}
        </div>
    );
}
export default KanbasNavigation;
